import { useState } from "react";
import { useHistory } from "react-router";
import TextField from "@material-ui/core/TextField";
import {RangeStepInput} from 'react-range-step-input';
import './index.css'

function ProfessorForm() {
    let history = useHistory();
    let token = localStorage.getItem('Token')
    let userName = localStorage.getItem('userName')
    const [professorName, setProfName] = useState('')
    const [profRate, setProfRate] = useState('')
    const [profComment, setProfComment] = useState('')

    const clickEntry = () => {
        const prof_rate = {'professor_name': professorName, 'userame': 'chenhaoyu', professorName, 'courserate': profRate, 'coursecomment':profComment}
        const request = new Request('http://34.126.85.190:8080/course/add', {
            method: "POST",
            body: JSON.stringify(prof_rate),
            headers: {
                'Token': token,
                Accept: "application/json, text/plain, */*",
                "Content-Type": "application/json"
            }
        });
        fetch(request)
            .then(function(res) {
            console.log(res.status)
            if (res.status === 0) {
                alert('sign up success')
                console.log('success')
                history.push("/dashboard");
            } else {
                alert('sign up failed') 
            }
            })
            .catch(error => {
            console.log(error);
            });
        // history.push('/dashboard')
    }

    return (
        <div className="courseRateForm">
            <h2>Create a new comment and rate for a course</h2>
            <a href="/dashboard">Go back to course comments page </a>
            <div>
                <TextField
                    name="profName"
                    label="Professor Name"
                    id="outlined-basic"
                    variant='outlined'
                    margin="normal"
                    onChange={e => setProfName(e.target.value)}
                />
            </div> 
            <div>
                <RangeStepInput min={0} max={5} value={profRate} step={0.5} onChange={(e)=>setProfRate(e.target.value)}/>
            </div>
            <div>
                <p>Comments</p>
                <textarea id="courseComments" name="courseComments" maxLength="100"
                onChange={(e)=>setProfComment(e.target.value)}>

                </textarea>
            </div>
            <button className="small green button" onClick={clickEntry}>
                Complete
            </button>
        </div>
    );
  }

  export default ProfessorForm;
